import { Icon, Modal } from "web3uikit";
import { useState }  from "react";
import {useMoralis} from "react-moralis";

function User() {

  const [isVisible, setVisible] =  useState(false);
  const { Moralis }  = useMoralis();
  const [userRentals,  setUserRentals] = useState();

  useEffect(() => {
    async function fetchRentalsList() {
      const Rentals = Moralis.Object.extend("Rentals");
      const query = new Moralis.Query(Rentals);
      query.equalTo("city", searchFilters.destination);
      query.greaterThanOrEqualTo("maxGuests_decimal", searchFilters.guests);

      const result = await query.find();

      let cords = [];
      result.forEach((e) => {
        cords.push({ lat: e.attributes.lat, lng: e.attributes.long });
      });

      setCoordinates(cords);
      setRentalsList(result);
    }

    fetchRentalsList();
  }, [searchFilters]);


  return (
    <>
      <div onClick={() => setVisible(true)}>
        <Icon fill="#000000" size={24} svg="user" />
      </div>

      <Modal
      onCloseButtonPressed={() => setVisible(false)}
      hasFooter={false}
      title="Your Stays"
      isVisible={isVisible}
      >

      </Modal>
    </>
  );
}

export default User;
